다른분들은 다들 나스챠를 보고싶어 유모들을 레일라라고 부르는것같다하시는데..
전 달리 느껴집니다.
영악하기그지없는 아샤는 파디샤의 눈과 귀를 가려 아직도 아샤옆에 나스챠가 있는것처럼 꾸미는것 같거든요..;;

&#x27;난 더 이상 파디샤의 부름을 받지 못할지도 몰라 그렇게 되어도 과연 네가 내 곁에 있을까?&#x27;

&quot;나는 네가 발이 부르트도록 춤을 추는 것을 보았어. 무척 아름다웠어. 그 어떤 여인보다도 더.&quot;

아샤x나스챠 사랑해~!!!!!

와 저 언니 겁나 맘에들어
대충 키스하고선 &#x27;더러운거 라고 하셨습니다&#x27;
ㅋㄷ 술탄 한대 맞았다

아;;속이 다 울렁거린다;;;
당한 피해자는 장난 아니게 끔직하겠다 
어우;;;

&lt;HARUHARU 추리 제 5장&gt;

검색기록에 대한 추가 설명.
아무리 남편인 김작가가 미워도 한때 자신의 우상이었던, 그리고 첫사랑이었던 김작가를 김시현이 죽이기에는 이유가 더 필요하다는 점에서 검색기록으로 추측할 수 있다. 검색기록의 경우 제3자(아마도 김시현)가 일부러 남겼을 가능성과 김작가 본인의 입력일 가능성이 있는데, 아마도 김작가의 기록으로 보인다. 김시현이 건드렸다면 용의자에서 피하고 싶을 만큼 불리한 검색기록을 삭제하고 갔을 것이나 그렇지 않으므로 김작가의 입력일 가능성이 크다. 의아한 것은 완전범죄라는 키워드인데,

&lt;HARUHARU 추리 제 4장&gt;

고영민은 범인은 아니나 김작가가 살해된 후 현장의 사진을 찍어 유포했을 것이다. 
설명1, 나머지 용의자도 별로 김작가에게 호감을 가지고 있지는 않는 것으로 보이지만, 일단 고영민은 김 작가에게 별로 호감을 가지고 있지 않고 김작가의 치부를 접하게 되면 빅엿을 먹이고 싶은 마음은 자연스럽게 있었을 것이다. 사진의 최초유포자가 그의 여자친구 세나의 친구인 걸로 보아 사진을 최초로 촬영한 사람은 세나와 관련된 사람, 즉 고영민일 것으로 추측할 수 있다. 김작가를 까고 싶지만 당연히 자신이 먼저 지목되

&lt;HARUHARU 추리 제 3장&gt;

최승철은 범인이 아니다. 
설명1, 범인이라고 가정했을 경우 주장하는 알리바이가 너무 대충이다. 자고로 범인은 자신이 범인임을 들키지 않기 위해 알리바이 또는 내가 그 사람을 살해할 이유가 없다고 주장하겠지만 최승철은 집에 계속 있었고 또한 뭔가를 했다고 의심받기 쉬운데도 딱히 알리바이를 주장하지 않고 그냥 집에 있었다고 하고 조사를 하든 말든 상관없는 태도이다.

&lt;HARUHARU 추리 제 2장&gt;

김시현이 범인이다. 
설명1, 화학과 졸업생이라는 점이 걸린다. 장면에 김시현이 검은 봉지를 들고 쉐어하우스를 방문해 김 작가와 싸우고(김시현 본인 외의 진술) 갔는데, 검은 봉지에 기화할 독극물이 들어 있었던 것 아닐까? 설명2에서 설명하겠지만 김시현은 최승철의 블로그에서 김 작가 살해방법의 힌트를 얻었을 가능성이 있으며, 무엇보다 화학과 졸업생이라고 굳이 설정된 가정이 매우 걸린다.
